long long continuousSubarrays(int* nums, int numsSize) {
    long long count = 0;
    int start = 0; // Start of the current continuous subarray

    for (int end = 0; end < numsSize; ++end) {
        // Expand the window to include nums[end] if it is continuous.
        for (int i = start; i < end; ++i) {
            // If the condition is violated for any pair within the window, move the start forward.
            if (abs(nums[i] - nums[end]) > 2) {
                start = i + 1;
            }
        }

        // All subarrays ending at 'end' and starting from 'start' to 'end' are continuous.
        count += (end - start + 1);
    }

    return count;
}
